import * as VKID from '@vkid/sdk';

VKID.Config.init({
  app: 0,
});

const oneTap = new VKID.OneTap();

const container = document.getElementById('VkIdSdkOneTap');

if (container) {
  oneTap.render({ container });
}

// Удалить iframe можно с помощью oneTap.close();
